import Todo from "./Todo";
function TodoList(props) {
  return (
    <ul className="list-group shadown mt-3">
      {props.todoList.map((item) => {
        return <Todo key={item.id} title={item.title} completed={item.completed}></Todo>;
      })}
    </ul>
  );
}
export default TodoList;
